    pm.response.to.be.ok;
});

pm.test("Content-Type", function () {
    pm.response.to.have.header("Content-Type");
});

pm.test("Response time < 500ms", function () {
    pm.expect(pm.response.responseTime).to.be.below(500);
});

pm.test("Body in response", function () {
    pm.response.to.be.withBody;
});

pm.test("Response is json", function () {
    pm.response.to.be.json;
});

pm.test("Max Page Size is 10", function () {
    var jsonData = pm.response.json();
    pm.expect(jsonData.objects.length) < 11;
});

pm.test("Page Parameter", function () {
    var jsonData = pm.response.json();
    pm.expect(jsonData.objects.page == 2);
});

pm.test("Filter", function () {
    var jsonData = pm.response.json();
    jsonData.objects.map((obj)=> {
        pm.expect(obj.city.includes("a"));        
    })

});

pm.test("Order By", function () {
    var jsonData = pm.response.json();
    for ( i = 1; i < jsonData.total_pages; i++){
        pm.expect(jsonData.objects[i] > jsonData.objects[i-1]);    
    }
});

